import React from 'react';
import { Outlet, Link } from "react-router-dom";
import '../App.css';
import logo from './logo.jpeg'; 

function Nav(){
  return(
    <>
    <nav>
      <div class='logo'>
      <img src='../assets/logo.jpg' alt="myburger"></img>
      </div>
      <Link to="/">Burger Builder</Link>
      <Link to="/signup">Signup</Link>
    </nav>

    <Outlet />
  </>
    );
}
export default Nav;
